import React, {useEffect,useState} from 'react'


const NotesListsPage = () => {

    let [notes,setNotes]=useState([])

    useEffect(()=>{
     fetch("http://127.0.0.1:8000/api/notes/")
     .then(res=>res.json())
     .then(data=>setNotes(data))
    },[])

    console.log()
   

  return (
    <div>


    </div>
  )
}

export default NotesListsPage
